text:
在IG上超火紅的飲料店🔥🤤🔥
是怎麼在手搖店林立的台北東區殺出一條血路的😤
是由三個門外漢憑著一股初心與執念打造的飲品店！
不只是一杯飲料，而是生活的療癒配方
希望客人能夠喝杯飲料，偷點悠閒的時光😍
想知道是哪家店，下面留貼圖！
